import { useState,useEffect} from "react";
import React from "react";

async function Profile({ auth }) {
  const [data, setData] = useState([]);
  useEffect(() => {
    const api = fetch("https://retoolapi.dev/GFHqAV/getemployees")
      .then((res) => res.json())
      .then((json) => {
        setData(json);
      })
      .catch((e) => {
        console.log("e", e);
      });
  }, []);

  return (
    <div>
      Hello User!
      {/* <div>{data.map((val)=>{val.})}</div> */}
    </div>
  );
}

export default Profile;
